import React from 'react';
import ReactDOM from 'react-dom';
import {nanoid} from 'nanoid';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';

const DATA = [
  {id: nanoid(), name: "SA Travel Form", projType: "work", skills:["Vanilla JS", "HTML", "CSS", "MySQL", "PHP"], desc:"Travel form for Binghamton University's Student Association", link:"https://www.forms.binghamtonsa.org/travel/"},
  {id: nanoid(), name: "SA Timesheet System", projType: "work", skills:["Ruby on Rails", "JS"], desc:"Timesheet for Student Association employees", link:"https://github.com/MatthewDamiata/SA-Timesheet-System"},
  {id: nanoid(), name: "Knits N Things", projType: "personal", skills:["React","HTML", "CS"], desc:"Mock Ecommerce website dedicated to handmade crochet projects", link:"https://github.com/queendallen/knitsnthings"},
  {id: nanoid(), name: "Weather App", projType: "personal", skills:["React", "HTML", "CS"], desc:"Mock Ecommerce website dedicated to handmade crochet projects", link:"https://github.com/queendallen/knitsnthings"}
];

ReactDOM.render(
  <React.StrictMode>
    <App projects={DATA}/>
  </React.StrictMode>,
  document.getElementById('root')
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
